import React from "react";
import likedArt from './liked.js';

export default function Liked () {
    return(
        <main className="liked-page">
            <div className="liked-page-heading">
                <h1 className="liked-page-h1">Liked Pieces</h1>
                <p className="liked-page-p">Save art from the gallery in your liked page.</p>
            </div>
            <div className="gallery">
                {likedArt.map((art) => (
                    <div key={art.id} className="art-piece">
                        <img src={art.image} alt={art.title} className="art-image" />
                        <h2 className="art-title">{art.title}</h2>
                        <p className="art-artist">{art.artist}</p>
                    </div>
                ))}
            </div>
        </main>
    )
}
